;;; {"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;Lower is better&quot;</span>","value":"\"Lower is better\""},{"type":"html","content":"<span class='clj-keyword'>:fighter</span>","value":":fighter"}],"value":"[\"Lower is better\" :fighter]"}
;; <=

;; **
;;; ## Naming The Best
;;; 
;;; Knowing who's best isn't the same as stating who's best. This is where ```comparative-outcome-named``` comes in.
;;; 
;;; * ```comparative-outcome-named``` calls ```comparative-outcome``` and assigns the results to the supplied fighters.
;; **

;; @@
(defn comparative-outcome-named
  [fighter
   fighter2
   k]
  (let [full (fn [fighter]
               (reduce str
                       (interpose " "
                                  (map #(get-in fighter
                                                ["Name" %])
                                       ["FirstName"
                                        "NickName"
                                        "LastName"]))))
        possible {:fighter (full fighter)
                  :fighter2 (full fighter2)
                  :tied "Tied"}
        [measure-string winner] (comparative-outcome fighter
                                                     fighter2
                                                     k)]
    (format "%s - %s"
            measure-string
            (winner possible))))

;; Comparing the Age of two example fighters

(print "Age: "
       (comparative-outcome-named example-fighter
                                  example-fighter2
                                  "Age"))
